type MenuItem = Required<MenuProps>["items"][number];
type SideMenuProps = {
  menus: Menus[];
  router: AppRouterInstance;
};
export const generateSiderMenu = (props: SideMenuProps) => {
  const { menus, router } = props;
  const siderMenu: MenuItem[] = [];
  if (!menus.length) return siderMenu;
  const sortMenu = menus
    .map((val) => val)
    .sort((a, b) =>
      a.menu_order_no > b.menu_order_no
        ? 1
        : b.menu_order_no > a.menu_order_no
        ? -1
        : 0
    );
  sortMenu.forEach((menu, index) => {
    if (menu.is_active !== "N") {
      let iconVal;

      if (menu?.menu_icon?.startsWith("<sv")) {
        iconVal = <span dangerouslySetInnerHTML={{ __html: menu.menu_icon }} />;
      } else if (
        menu?.menu_icon === null ||
        menu?.menu_icon === "" ||
        !menu.menu_icon
      ) {
        iconVal = <></>;
      } else {
        iconVal = (
          <Image
            src={menu?.menu_icon}
            alt="icon"
            width={20}
            height={20}
            style={{ width: "15px", height: "20px", fill: "#1B99D5" }}
          />
        );
      }

      const sortChildrenMenu = menu.children
        ? menu.children
            .map((val) => val)
            .sort((a, b) =>
              a.menu_order_no > b.menu_order_no
                ? 1
                : b.menu_order_no > a.menu_order_no
                ? -1
                : 0
            )
        : null;
      const children = sortChildrenMenu
        ? generateSiderMenu({ menus: sortChildrenMenu, router })
        : [];

      if (children.length) {
        siderMenu.push({
          key: `${index}${menu.menu_id}${menu.menu_order_no}`,
          label: <div>{menu.menu_name}</div>,

          icon: iconVal,

          children: children,
        });
      } else {
        siderMenu.push({
          key: `${index}${menu.menu_id}${menu.menu_order_no}`,
          label: (
            <Link
              href={
                menu.menu_path && !menu.menu_path.startsWith("/")
                  ? "/" + menu.menu_path
                  : menu.menu_path!
              }
            >
              {menu.menu_name}
            </Link>
          ),
          icon: iconVal,
        });
      }
    } else {
      return <></>;
    }
  });
  return siderMenu;
};

